// StudentRow.js

import React from 'react';
import FileList from './FileList'; // Assumes FileList handles displaying the file and date
import GradeInput from './GradeInput'; // Placeholder for GradeInput component
import CommentInput from './CommentInput'; // Placeholder for CommentInput component

const StudentRow = ({ student, onGradeChange, onCommentChange }) => {
  return (
    <div className="student-row">
      <div className="student-name">{student.name}</div>
      <FileList files={student.files} />
      <GradeInput grade={student.grade} onGradeChange={onGradeChange} />
      <CommentInput comment={student.comment} onCommentChange={onCommentChange} />
    </div>
  );
};

export default StudentRow;
